import React, { Component } from 'react';

export default class Employee extends Component {
	constructor(props) {
		super(props)
	
		this.state = {
			 isLoggedIn:false
		}
	}
	render() {
      if(this.state.isLoggedIn)
      	return <div>Welcome Abhi</div>

		return (
			<div>
            <h1>Hello Abhi</h1>
            <h2>Welcome Guest</h2>
			</div>
		);
	}
}
